import React, { Component } from 'react';
import './headingeffect.css';

class FrontPageText extends Component {

  render() {
    return (
    	<div >
    		<h1 style={{color:'white',position:'absolute',top:270,left:550}}> ANJALI JAIN</h1>
    		<p style={{position:'relative',top:350,left:510}}>This is a typewriter effect.</p>
    		<span className='mouse'>
				<span className='mouse-movement'>
				</span>
			</span>
    	</div>
    );
  }
}

export default FrontPageText;
